import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const { colors } = theme.palette;
  return {
    svgIcon: {
      fill: colors.main50,
      marginBottom: 10,
      "&:hover": {
        color: colors.main,
        cursor: "pointer"
      }
    },
    socialLinks: {
      display: "flex",
      flexDirection: "column",
      position: "absolute",
      bottom: 0,
      left: 20
    }
  };
});
